-- ----------------------------
-- View structure for vu_employees
-- ----------------------------
DROP VIEW IF EXISTS `vu_employees`;
CREATE  VIEW `vu_employees` AS select `employees`.`EmpId` AS `EmpId`,`interviewees`.`Name` AS `Name`,`interviewees`.`Gender` AS `Gender`,`interviewees`.`Address` AS `Address`,`interviewees`.`Tel` AS `Tel`,`interviewees`.`Dob` AS `Dob`,`employees`.`Id_Card` AS `Id_Card`,`employees`.`HiredDate` AS `HiredDate`,`employees`.`BasicSalary` AS `BasicSalary`,`employees`.`BlockSalary` AS `BlockSalary`,`employees`.`Status` AS `Status`,`employees`.`Children` AS `Children`,`departments`.`Department` AS `Department`,`positions`.`Position` AS `Position`,`emptype`.`EmpType` AS `EmpType`,`workdays`.`Description` AS `Description`,`users`.`Username` AS `Username`,`employees`.`WorkDayId` AS `WorkDayId`,`employees`.`UserId` AS `UserId`,`employees`.`DepartmentId` AS `DepartmentId`,`employees`.`EmpTypeId` AS `EmpTypeId`,`employees`.`PositionID` AS `PositionID`,`employees`.`Privilige` AS `Privilige`,`employees`.`Office_Tel` AS `Office_Tel`,`employees`.`IntervieweeId` AS `IntervieweeId` from ((((((`employees` left join `emptype` on((`employees`.`EmpTypeId` = `emptype`.`EmpTypeId`))) left join `interviewees` on((`employees`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) left join `users` on((`employees`.`UserId` = `users`.`UserId`))) left join `departments` on((`employees`.`DepartmentId` = `departments`.`DepartmentId`))) left join `workdays` on((`employees`.`WorkDayId` = `workdays`.`WorkDayId`))) left join `positions` on((`employees`.`PositionID` = `positions`.`PositionID`))) order by `employees`.`EmpId`;

-- ----------------------------
-- View structure for vu_interview
-- ----------------------------
DROP VIEW IF EXISTS `vu_interview`;
CREATE   VIEW `vu_interview` AS select `interviews`.`InterviewID` AS `InterviewID`,`interviews`.`TotalNumberOfInterview` AS `TotalNumberOfInterview`,`interviews`.`DateOn` AS `DateOn`,`interviews`.`EmID` AS `EmID`,`interviewees`.`Name` AS `Name` from ((`interviews` join `employees` on((`interviews`.`EmID` = `employees`.`EmpId`))) join `interviewees` on((`employees`.`IntervieweeId` = `interviewees`.`IntervieweeId`)));

-- ----------------------------
-- View structure for vu_interview_details
-- ----------------------------
DROP VIEW IF EXISTS `vu_interview_details`;
CREATE   VIEW `vu_interview_details` AS select `interviewdetails`.`InterviewDetailId` AS `InterviewDetailId`,`interviewees`.`Name` AS `Name`,`interviewees`.`Blocked` AS `Blocked`,`interviewdetails`.`StatusCome` AS `StatusCome`,(select `positions`.`Position` from `positions` where (`positions`.`PositionID` = `interviewdetails`.`PositionID`)) AS `Position`,`interviewdetails`.`RecruitID` AS `RecruitID`,`interviewdetails`.`PositionID` AS `PositionID`,`interviewdetails`.`InterviewID` AS `InterviewID`,`interviewdetails`.`IntervieweeId` AS `IntervieweeId` from (`interviewdetails` join `interviewees` on((`interviewdetails`.`IntervieweeId` = `interviewees`.`IntervieweeId`)));

-- ----------------------------
-- View structure for vu_name_reinter_passed
-- ----------------------------
DROP VIEW IF EXISTS `vu_name_reinter_passed`;
CREATE   VIEW `vu_name_reinter_passed` AS select `reinters`.`ReInterId` AS `ReInterId`,`reinters`.`result` AS `result`,`reinters`.`IntervieweeId` AS `IntervieweeId`,`interviewees`.`Name` AS `Name`,`reinters`.`InterviewOn` AS `InterviewOn`,`interviewees`.`Status` AS `Status` from ((`reinters` join `reinterstaffs` on((`reinterstaffs`.`ReInterID` = `reinters`.`ReInterId`))) join `interviewees` on((`reinters`.`IntervieweeId` = `interviewees`.`IntervieweeId`)));

-- ----------------------------
-- View structure for vu_position_for_apply
-- ----------------------------
DROP VIEW IF EXISTS `vu_position_for_apply`;
CREATE   VIEW `vu_position_for_apply` AS select `rd`.`RecruitId` AS `RecruitId`,`r`.`DateCreated` AS `DateCreated`,`r`.`EndDate` AS `EndDate`,`p`.`Position` AS `Position`,`rd`.`PositionId` AS `PositionId` from ((`recruits` `r` join `recruitdetails` `rd` on((`rd`.`RecruitId` = `r`.`RecruitId`))) join `positions` `p` on((`rd`.`PositionId` = `p`.`PositionID`))) where ((select (to_days(`r`.`DateCreated`) - to_days(curdate()))) < 1);

-- ----------------------------
-- View structure for vu_recruit
-- ----------------------------
DROP VIEW IF EXISTS `vu_recruit`;
CREATE   VIEW `vu_recruit` AS select `r`.`RecruitId` AS `RecruitId`,date_format(`r`.`DateCreated`,'%Y-%m-%d') AS `DateCreated`,date_format(`r`.`EndDate`,'%Y-%m-%d') AS `EndDate`,`r`.`Description` AS `Description`,`r`.`ModifiedDate` AS `ModifiedDate`,`r`.`cEmpId` AS `cEmpId`,(select `interviewees`.`Name` from (`employees` join `interviewees` on((`employees`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) where (`employees`.`EmpId` = `r`.`cEmpId`)) AS `NameCreate`,`r`.`mEmpId` AS `mEmpId`,(select `interviewees`.`Name` from (`employees` join `interviewees` on((`employees`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) where (`employees`.`EmpId` = `r`.`mEmpId`)) AS `NameModify` from `recruits` `r`;

-- ----------------------------
-- View structure for vu_recruitdetails
-- ----------------------------
DROP VIEW IF EXISTS `vu_recruitdetails`;
CREATE   VIEW `vu_recruitdetails` AS select `recruitdetails`.`RecruitDetailId` AS `RecruitDetailId`,`recruitdetails`.`RecruitId` AS `RecruitId`,`positions`.`Position` AS `Position`,`timeshifts`.`Description` AS `Timeshift`,`recruitdetails`.`NumberNeeded` AS `NumberNeeded`,`recruitdetails`.`Duties` AS `Duties`,`recruitdetails`.`Requirements` AS `Requirements` from ((`recruitdetails` join `positions` on((`recruitdetails`.`PositionId` = `positions`.`PositionID`))) join `timeshifts` on((`recruitdetails`.`TimeShiftId` = `timeshifts`.`TimeShiftId`)));

-- ----------------------------
-- View structure for vu_reinters
-- ----------------------------
DROP VIEW IF EXISTS `vu_reinters`;
CREATE ALGORITHM = UNDEFINED DEFINER = `skip-grants user`@`skip-grants host` SQL SECURITY INVOKER VIEW `vu_reinters` AS select `reinters`.`ReInterId` AS `ReInterId`,`reinters`.`RecruitDetailId` AS `RecruitDetailId`,`reinters`.`InterviewOn` AS `InterviewOn`,`reinters`.`Status` AS `Status`,`reinters`.`result` AS `result`,`reinters`.`IntervieweeId` AS `IntervieweeId`,`interviewees`.`Name` AS `Name`,`recruitdetails`.`PositionId` AS `PositionId`,`positions`.`Position` AS `Position`,`reinterstaffs`.`EmpID` AS `EmpID`,(select `interviewees`.`Name` from (`employees` join `interviewees` on((`employees`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) where (`employees`.`EmpId` = `reinterstaffs`.`EmpID`)) AS `StaffName`,`reinterstaffs`.`ReInterStaffID` AS `ReInterStaffID` from ((((`reinters` join `reinterstaffs` on((`reinterstaffs`.`ReInterID` = `reinters`.`ReInterId`))) join `interviewees` on((`reinters`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) join `recruitdetails` on((`reinters`.`RecruitDetailId` = `recruitdetails`.`RecruitDetailId`))) join `positions` on((`recruitdetails`.`PositionId` = `positions`.`PositionID`)));

-- ----------------------------
-- View structure for vu_study
-- ----------------------------
DROP VIEW IF EXISTS `vu_study`;
CREATE   VIEW `vu_study` AS select `studyrecords`.`StudyRecordId` AS `StudyRecordId`,`interviewees`.`Name` AS `Name`,`studyrecordtypes`.`StudyRecordType` AS `StudyRecordType`,`categorys`.`CatName` AS `CatName`,`majors`.`Major` AS `Major`,`studyrecords`.`Description` AS `Description`,`studyrecords`.`Skill` AS `Skill`,`studyrecords`.`EndYear` AS `EndYear` from ((((`studyrecords` join `studyrecordtypes` on((`studyrecords`.`StudyRecordTypeId` = `studyrecordtypes`.`StudyRecordTypeId`))) join `interviewees` on((`studyrecords`.`IntervieweeId` = `interviewees`.`IntervieweeId`))) join `categorys` on((`studyrecords`.`CatID` = `categorys`.`CatID`))) join `majors` on((`studyrecords`.`MajorId` = `majors`.`MajorId`)));

-- ----------------------------
-- View structure for vu_traniningcour
-- ----------------------------
DROP VIEW IF EXISTS `vu_traniningcour`;
CREATE   VIEW `vu_traniningcour` AS select `trainingcourserecords`.`TrainingCourseId` AS `TrainingCourseId`,`interviewees`.`Name` AS `Name`,`trainingcoursetypes`.`TrainingCourseType` AS `TrainingCourseType`,`trainingcourserecords`.`SkillTraining` AS `SkillTraining`,`trainingcourserecords`.`Description` AS `Description`,`trainingcourserecords`.`DateStart` AS `DateStart`,`trainingcourserecords`.`DateEnd` AS `DateEnd` from ((`trainingcourserecords` join `trainingcoursetypes` on((`trainingcourserecords`.`TrainingCourseTypeId` = `trainingcoursetypes`.`TrainingCourseTypeId`))) join `interviewees` on((`trainingcourserecords`.`IntervieweeId` = `interviewees`.`IntervieweeId`)));

-- ----------------------------
-- View structure for workexp
-- ----------------------------
DROP VIEW IF EXISTS `workexp`;
CREATE   VIEW `workexp` AS select `workexperiences`.`WorkExperienceId` AS `ID`,`interviewees`.`Name` AS `Name`,`positions`.`Position` AS `Position`,`workexperiences`.`Description` AS `Description`,`workexperiences`.`Skill` AS `Skill`,`workexperiences`.`DateStart` AS `DateStart`,`workexperiences`.`DateEnd` AS `DateEnd`,`workexperiences`.`ExperienceOfYear` AS `ExperienceOfYear` from ((`workexperiences` join `interviewees` on(((`workexperiences`.`IntervieweeId` = `interviewees`.`IntervieweeId`) and (`workexperiences`.`IntervieweeId` = `interviewees`.`IntervieweeId`)))) join `positions` on((`workexperiences`.`PositionId` = `positions`.`PositionID`)));

-- ----------------------------
-- Procedure structure for ADDWEP
-- ----------------------------
DROP PROCEDURE IF EXISTS `ADDWEP`;
delimiter ;;
CREATE   PROCEDURE `ADDWEP`(IN posid INT(11),IN des VARCHAR(255),IN skill VARCHAR(255),IN ds DATE,IN de DATE,IN inwe INT(11),IN exyear INT(11))
BEGIN
	INSERT INTO workexperiences
	(PositionId, Description, Skill, DateStart, DateEnd, IntervieweeId, ExperienceOfYear)
	VALUES(posid, des, skill,ds, de, inwe, exyear);
END
;;
delimiter ;

