-- Procedure structure for deleteWEP
-- ----------------------------
DROP PROCEDURE IF EXISTS `deleteWEP`;
delimiter ;;
CREATE   PROCEDURE `deleteWEP`(in wid int(11))
BEGIN
		DELETE FROM workexperiences
		WHERE WorkExperienceId=wid;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for findstudy
-- ----------------------------
DROP PROCEDURE IF EXISTS `findstudy`;
delimiter ;;
CREATE   PROCEDURE `findstudy`(in s varchar(255))
begin
	select * from vu_study where concat(StudyRecordId, Name, StudyRecordType, CatName, Major, Description, Skill) COLLATE utf8_unicode_ci
	like concat('%',s,'%')COLLATE utf8_unicode_ci limit 50 ;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for FindTraincour
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindTraincour`;
delimiter ;;
CREATE   PROCEDURE `FindTraincour`(in s varchar(255))
begin
	select * from vu_traniningcour where concat(TrainingCourseId, Name, TrainingCourseType, SkillTraining, Description)
	like concat('%',s,'%') limit 50;
end
;;
delimiter ;

