-- ----------------------------
-- Procedure structure for ViewInterWe
-- ----------------------------
DROP PROCEDURE IF EXISTS `ViewInterWe`;
delimiter ;;
CREATE   PROCEDURE `ViewInterWe`(IN search VARCHAR(255))
BEGIN
	SELECT 
    i.IntervieweeId,
	i.`Name`,
	i.Gender,
	i.Address,
	i.Tel,
	i.Blocked,
	i.Degree,
	i.`Language`,
	i.Skill,
	i.Dob,
	i.Email,
    sp.StudyRecordType,
	c.CatName,
	m.Major,
	s.Skill,
	s.Description,
	s.EndYear,
    wp.WorkExperienceId,
	p.Position,
	wp.Skill,
	wp.DateStart,
	wp.DateEnd,
	wp.ExperienceOfYear,
    y.TrainingCourseType,
    t.Description,
    t.SkillTraining,
    t.DateStart,
    t.DateEnd
FROM
    interviewees i
        LEFT JOIN
    studyrecords s ON i.IntervieweeId = s.IntervieweeId
        LEFT JOIN
    studyrecordtypes sp ON s.StudyRecordId = sp.StudyRecordTypeId
        LEFT JOIN
    categorys c ON s.CatID = c.CatID
        LEFT JOIN
    majors m ON s.MajorId = m.MajorId
        LEFT JOIN
    workexperiences wp ON i.IntervieweeId = wp.IntervieweeId
        LEFT JOIN
    positions p ON wp.PositionId = p.PositionID
	left join
    trainingcourserecords t on t.IntervieweeId = i.IntervieweeId 
    left join
    trainingcoursetypes y on t.TrainingCourseTypeId = y.TrainingCourseTypeId
WHERE
    MATCH (i.Name , i.Language , i.Degree , i.Email , i.Status , i.Skill) AGAINST (search IN BOOLEAN MODE)
        OR MATCH (s.Description , s.Skill) AGAINST (search IN BOOLEAN MODE)
        OR MATCH (wp.Description , wp.Skill) AGAINST (search IN BOOLEAN MODE)
        OR MATCH (c.CatName) AGAINST (search IN BOOLEAN MODE)
        OR MATCH (m.Major) AGAINST (search IN BOOLEAN MODE)
ORDER BY MATCH (i.Name , i.Language , i.Degree , i.Email , i.Status , i.Skill) AGAINST (search IN BOOLEAN MODE) + MATCH (s.Description , s.Skill) AGAINST (search IN BOOLEAN MODE) + MATCH (wp.Description , wp.Skill) AGAINST (search IN BOOLEAN MODE);
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;


